  min-height: 100vh;
  background-size: cover;
  color: #1e2329;
}

.header {
  background: url("../images/header_bg.svg") no-repeat left center;
  background-size: cover;
  height: 60px;
}

.header .container {
  display: flex;
  justify-content: space-between;
  align-items: center;
}

.header .brand {
  display: flex;
  justify-content: start;
  align-items: center;
  padding: 10px 0;
}

.header .brand .logo {
  display: block;
  margin-right: 12px;
}

.header .brand .logo > img {
  width: 45px;
  height: auto;
}

.header .brand .slogan {
  font-weight: normal;
  font-size: 16px;
  color: #fff;
  margin: 0;
}

.header .language-switcher {
  position: relative;
}

.header .language-switcher .dropdown-button {
  font-size: 14px;
  color: #fff;
  display: flex;
  align-items: center;
  justify-content: flex-start;
  cursor: pointer;
}

.header .language-switcher .dropdown-button > label > i {
  font-size: 12px;
  margin-left: 3px;
}

.header .language-switcher .dropdown-button:hover > label {
  color: #c9111f;
}

.header .language-switcher .dropdown-button > .flag {
  width: 24px;
  margin: 8px;
}

.header .language-switcher .dropdown-menu {
  display: none;
  position: absolute;
  padding: 3px 0;
  list-style: none;
  width: max-content;
  border-radius: 3px;
  background-color: #fff;
  box-shadow: 0 3px 5px rgb(9 30 66 / 20%), 0 0 0 rgb(9 30 66 / 31%);
  right: 0;
  transform-origin: top right;
  z-index: 1;
}

.header .language-switcher .dropdown-menu::before {
  content: "";
  position: absolute;
  border: solid 6px transparent;
  border-bottom-color: #fff;
  right: 8px;
  top: -12px;
}

.header .language-switcher .dropdown-item {
  display: flex;
  padding: 4px 8px;
  font-size: 14px;
  align-items: center;
  justify-content: flex-start;
  cursor: pointer;
  transition: all 0.3s ease;
}

