          const currentToken = window.localStorage.getItem("chartToken") || "";

          if (!currentToken || currentToken !== token) {
            if (token !== "guest") {
              window.localStorage.setItem("chartToken", token);
              window.location.reload();
            } else {
              window.localStorage.setItem("chartToken", "");
            }
          }

          // If the token is guest, we will clear the token from the local storage on android
          if (currentToken && token === "guest") {
            window.localStorage.setItem("chartToken", "");
